import React from 'react';
import ReactDOM from 'react-dom';

const SearchPanel = () => {
    return (
        <input type="text" placeholder="search"/>
    );
};

const App = () => {
    return(
        <div>
            <AppHeader />
            <SearchPanel />
            <TodoList />
        </div>
    );
};

ReactDOM.render(<App />, document.querySelector('#root'));
